#include "../../headers/CrossSections/CrossSection_ccXX.h"

CrossSection_ccXX::CrossSection_ccXX(DarkSectorModel const &DSMod, Particle const &chii, Particle const &chij, Particle const &Xa, Particle const &Xb)
    : CrossSection(chii, chij, Xa, Xb)
{
    // std::cout << chii.get_index() << std::endl;
    int n_chi = DSMod.get_n_DS_DM();
    int n_X = DSMod.get_n_DS_X();

    aXcc = DSMod.get_a_VEC_DM();
    bXcc = DSMod.get_b_VEC_DM();

    // First cross section
    std::vector<Particle> as, at, au;

    int const nX = n_X;
    int const nt = n_chi;
    int nu = 0;
    int ns = 0;

    // Avoid the u channel if the two incoming and outgoing particles are the same
    if ((n_chi > 1 && &chii != &chij) || &Xa == &Xb)
        nu = n_chi;
    else
        nu = 0;

    as.resize(ns);
    at.resize(nt);
    au.resize(nu);

    for (int i = 0; i < nt; i++)
        at[i] = DSMod.get_chi(i);

    if ((n_chi > 1 && &chii != &chij) || &Xa == &Xb)
        for (int i = 0; i < nu; i++)
            au[i] = DSMod.get_chi(i);

    mi = _m1;
    mj = _m2;
    mXa = _m3;
    mXb = _m4;

    mc = (mi + mj) / 2;
    Mc = sqrt(mi * mj);
    dc = (mj - mi) / 2;

    Initialise(as, at, au, "ccss");

    i = chii.get_specific_index();
    j = chij.get_specific_index();
    a = Xa.get_specific_index();
    b = Xb.get_specific_index();
}

